import React from 'react';
import { HeaderArea } from './styled';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <HeaderArea>
            <div className="container">
                <div className="logo">
                    <Link to="/">
                        <img alt="logo MBS" src="...components/images/logo1.png"/>
                    </Link>
                </div>
            </div>
        </HeaderArea>
    );
}

export default Header;
